        "!pip install -q gradio\n",
        "import gradio as gr\n",
        "\n",
        "def user_rainfall_prediction(temp_avg, humidity_avg, pressure_avg,\n",
        "                             dew_avg, wind_avg, visibility_avg, month):\n",
        "\n",
        "    input_data = {\n",
        "        'TempHighF': temp_avg + 5, 'TempAvgF': temp_avg, 'TempLowF': temp_avg - 5,\n",
        "        'DewPointHighF': dew_avg + 2, 'DewPointAvgF': dew_avg, 'DewPointLowF': dew_avg - 2,\n",
        "        'HumidityHighPercent': humidity_avg + 5, 'HumidityAvgPercent': humidity_avg, 'HumidityLowPercent': humidity_avg - 5,\n",
        "        'SeaLevelPressureHighInches': pressure_avg + 0.1, 'SeaLevelPressureAvgInches': pressure_avg, 'SeaLevelPressureLowInches': pressure_avg - 0.1,\n",
        "        'VisibilityHighMiles': visibility_avg + 2, 'VisibilityAvgMiles': visibility_avg, 'VisibilityLowMiles': max(0, visibility_avg - 2),\n",
        "        'WindHighMPH': wind_avg + 5, 'WindAvgMPH': wind_avg, 'WindGustMPH': wind_avg + 10,\n",
        "        'Month': month\n",
        "    }\n",
        "\n",
        "    input_df = pd.DataFrame([input_data])\n",
        "    scaled_input = scaler.transform(input_df)\n",
        "    prediction = best_model.predict(scaled_input)[0]\n",
        "    return f\"Predicted Rainfall: {max(0, round(prediction,3))} inches\"\n",
        "\n",
        "app = gr.Interface(\n",
        "    fn=user_rainfall_prediction,\n",
        "    inputs=[\n",
        "        gr.Slider(40,110,75,label=\"Temperature (Â°F)\"),\n",
