        "        gr.Number(10.0,label=\"Wind Speed\"),\n",
        "        gr.Slider(0,10,10,label=\"Visibility\"),\n",
        "        gr.Dropdown(list(range(1,13)),6,label=\"Month\")\n",
        "    ],\n",
        "    outputs=gr.Textbox(label=\"Rainfall Forecast\"),\n",
        "    title=\"Rainfall Prediction System\"\n",
